"use strict";
module.exports = /*#__PURE__*/JSON.parse('{"translation":{"NavBar":{"Home":"Startseite","About":"Über uns","Services":"Dienstleistungen","Contact":"Kontakt","Team":"Team"},"Home":{"Meta":{"Title":"Startseite | Ark Fiduciaire","Description":"Fachkundige Unterstützung für Ihr Unternehmen – von der Gründung bis zum Erfolg. Buchhaltung, Steuern, Lohnabrechnung und Firmendienstleistungen in der Schweiz."},"Hero":{"Title":"Schweizer Buchhaltungs- & Firmendienstleistungen","Description":"Fachkundige Unterstützung für Ihr Unternehmen – von der Gründung bis zum Erfolg.","CTA":"Kontakt aufnehmen","SecondaryCTA":"Mehr erfahren","Badge":"Swiss Made","AI":"KI-gestützt","OdooBadge":"Offizieller Odoo-Partner"},"Services":{"Title":"Unsere Dienstleistungen"},"FAQ":{"Title":"Häufig gestellte Fragen","Subtitle":"Schnelle Antworten auf häufige Fragen zu unseren Produkten und Dienstleistungen."},"Testimonials":{"SectionTitle":"Referenzen"},"Contact":{"Title":"Kontakt aufnehmen"}},"Team":{"Title":"Unser Team kennenlernen","Subtitle":"Ein Team mit ergänzenden Talenten","Role":{"Partner":"Partner","ManagingPartner":"Geschäftsführender Partner","Tax":"Steuern","OfficeProjectManager":"Office & Projektmanager"}},"specificKey":"Übersetzter Wert","Accounting":{"Presentation":{"Title":"Ganzheitliche Sicht auf Ihre Buchhaltung","Subtitle":"Ein 360°-Angebot","Intro":["Wir widmen uns der Bereitstellung umfassender und maßgeschneiderter Lösungen, die darauf ausgelegt sind, alle Aspekte Ihrer finanziellen und buchhalterischen Anforderungen mit Präzision und Weitblick zu adressieren.","Über die Zahlen hinaus bieten wir strategische Beratung, um Ihr Wachstum zu unterstützen, Herausforderungen zu meistern und Marktchancen mit Weitblick zu nutzen. Wir sind Ihr strategischer Partner, der sich für den Erfolg Ihres Unternehmens engagiert."],"General":{"Title":"Finanzbuchhaltung","Desc":"Bei Ark Fiduciaire beherrschen wir alle Facetten der Finanzbuchhaltung – vom Hauptbuch über den Jahresabschluss bis hin zum Controlling. Unsere Fachleute sorgen dafür, dass jedes Buch aktuell, präzise und konform mit Branchenstandards und Vorschriften geführt wird.","List":["Individueller Kontenplan","Kreditoren- und Debitorenmanagement","Zahlungsmanagement","Liquiditätsmanagement"]},"Analytic":{"Title":"Kostenrechnung","Desc":"Die Kostenrechnung ist ein leistungsstarkes Instrument, um zu verstehen, wo und wie Sie Gewinne erzielen, sowie Bereiche zu identifizieren, die besondere Aufmerksamkeit erfordern. Unsere Experten bei Ark Fiduciaire helfen Ihnen, ein effektives Kostenrechnungssystem einzurichten und zu analysieren, damit Sie fundiertere Geschäftsentscheidungen treffen können."},"Periodic":{"Title":"Periodische Aufgaben","Desc":"Profitieren Sie von einer sorgenfreien Verwaltung dank unserer Expertise bei der Erstellung periodischer Abrechnungen für alle Ihre Verpflichtungen, darunter:","List":["Zwischen- und/oder Jahresabschluss","Halbjährliche oder vierteljährliche Mehrwertsteuer","Sozialversicherungen","Steuererklärung","Ordentliche und außerordentliche Generalversammlungen","Verwaltungsrat"],"Followup":"Unser engagiertes Team begleitet Sie bei jedem Schritt und sorgt für eine transparente und optimierte Verwaltung Ihrer Abrechnungen, damit Sie sich auf Ihr Kerngeschäft konzentrieren können."},"Dashboards":{"Title":"Dashboards","Desc":"Optimieren Sie die Übersicht und Kontrolle über Ihre Finanzen mit unseren innovativen Buchhaltungs-Dashboards. Die Dashboards bieten eine klare und zugängliche Zusammenfassung Ihrer Finanzdaten und ermöglichen fundierte und strategische Entscheidungen. Genießen Sie eine vereinfachte Verwaltung mit intuitiven Dashboards, die auf Ihre spezifischen Bedürfnisse zugeschnitten sind. Mit einer benutzerfreundlichen Oberfläche und präzisen Analysen sorgen unsere Lösungen für eine effektive Überwachung Ihrer finanziellen Gesundheit."},"Custom":{"Title":"Maßgeschneiderte Dienstleistungen"},"Experts":{"Title":"Experten","Desc":"Ark Fiduciaire stützt sich auf ein Team erfahrener und zertifizierter Buchhalter und Steuerexperten, die lokale und internationale Vorschriften beherrschen. Diese Expertise gewährleistet präzise und konforme Buchführung und sorgt für eine zuverlässige und harmonische Verwaltung."},"TimeEfficiency":{"Title":"Zeitersparnis und Effizienz","Desc":"Durch die Auslagerung der Buchhaltung an Ark Fiduciaire können sich Unternehmen auf ihr Kerngeschäft konzentrieren. Unsere Dienstleistungen sparen Zeit und verbessern die operative Effizienz, indem wir das gesamte Finanzmanagement übernehmen."},"CustomSolutions":{"Title":"Individuelle Lösungen","Desc":"Ark Fiduciaire bietet maßgeschneiderte Buchhaltungsdienstleistungen, die auf die spezifischen Bedürfnisse jedes Kunden zugeschnitten sind. Ob kleines Unternehmen, Großkonzern, NGO oder Tochtergesellschaft – wir passen unsere Leistungen flexibel an Ihre Anforderungen an."},"AdvancedTech":{"Title":"Fortschrittliche Technologie und Echtzeit-Management","Desc":"Wir nutzen die neuesten Buchhaltungstechnologien und -software, um ein optimales Management zu gewährleisten. Diese Tools ermöglichen eine präzise und schnelle Verwaltung der Finanzdaten sowie einen einfachen und sicheren Echtzeitzugriff auf Informationen."},"Consulting":{"Title":"Beratung","Desc":"Bei Ark Fiduciaire beschränken wir uns nicht auf die Buchführung. Wir bieten auch hochwertige Buchhaltungsberatung. Unsere Experten helfen Ihnen, Ihre Finanzen zu strukturieren, Ihre Steuern zu planen und Ihre Liquidität zu steuern, während sie Verbesserungsmöglichkeiten identifizieren."}}},"ServicesElements":{"FAQ":{"Title":"Häufig gestellte Fragen","Subtitle":"Schnelle Antworten auf häufige Fragen zu unseren Produkten und Dienstleistungen.","Question1":"Wer benötigt Buchhaltungsdienstleistungen in der Schweiz?","Answer1":"Jedes Unternehmen, das in der Schweiz tätig ist – von Start-ups bis zu Großunternehmen – benötigt Buchhaltungsdienstleistungen, um die Einhaltung der lokalen Steuer- und Finanzgesetze sicherzustellen.","Question2":"Welche Dienstleistungen bieten Buchhalter in der Schweiz an?","Answer2":"Buchhalter in der Schweiz bieten eine Vielzahl von Dienstleistungen an, darunter Buchführung, Erstellung von Jahresabschlüssen, Steuerplanung und -erklärung, Mehrwertsteuerdienste, Lohnbuchhaltung, HR- und Vertragsunterstützung sowie Unterstützung bei Prüfungen.","Question3":"Ist die Mehrwertsteuerregistrierung in der Schweiz verpflichtend?","Answer3":"Ja, wenn Ihr Jahresumsatz CHF 100.000 übersteigt, müssen Sie sich für die Mehrwertsteuer registrieren.","Question4":"Wie hoch sind die Unternehmenssteuersätze in der Schweiz?","Answer4":"Die Unternehmenssteuersätze in der Schweiz variieren je nach Kanton und Gemeinde und liegen in der Regel zwischen 11,9 % und 21,6 %. Der Bundessteuersatz auf den Nettogewinn beträgt 8,5 %.","Question5":"Was ist der Unterschied zwischen Kapitalsteuer und Vermögenssteuer?","Answer5":"Die Kapitalsteuer bezieht sich auf das Eigenkapital eines Unternehmens, einschließlich Aktienkapital und Gewinnrücklagen. Die Vermögenssteuer wird auf den Gesamtwert der von Einzelpersonen gehaltenen Vermögenswerte erhoben und betrifft Einzelunternehmer.","Question6":"Wie funktioniert die Zusammenarbeit, wenn wir Odoo für unsere Buchhaltung nutzen?","Answer6":"Sie behalten die volle Kontrolle und Eigentum an Ihren Daten mit Ihrem eigenen Odoo-Konto. Als offizielle Odoo-Partner verbinden wir uns mit Ihrem System, um Unterstützung zu bieten. So behalten Sie den Überblick über alle Abläufe, während wir die von Ihnen delegierten Aufgaben übernehmen – für eine transparente und partnerschaftliche Zusammenarbeit.","Question7":"Können wir bestimmte Buchhaltungsaufgaben delegieren und andere selbst erledigen?","Answer7":"Absolut. Unser Odoo-basiertes Servicemodell ist flexibel. Sie können Aufgaben wie Rechnungsstellung und Spesenverwaltung selbst übernehmen und komplexere Arbeiten wie Abschluss und Steuererklärungen an uns delegieren. Sie bestimmen, wie viel Sie abgeben.","Question8":"Helfen Sie bei der Einrichtung von Odoo für Buchhaltung und Lohnabrechnung?","Answer8":"Ja, als offizielle Odoo-Partner bieten wir vollständige Implementierungs- und Konfigurationsdienste. Wir sorgen dafür, dass Ihr Odoo-System den Schweizer Buchhaltungsstandards entspricht und das Lohnmodul vollständig swissdec-konform ist.","Question9":"Wie verwalten Sie swissdec-konforme Lohnabrechnung und Versicherungen?","Answer9":"Wir übernehmen alle Aspekte der Lohnabrechnung über unsere swissdec-zertifizierte Odoo-Plattform. Dazu gehören die monatliche Gehaltsabrechnung, die Erstellung von Lohnscheinen und die elektronische Übermittlung aller Daten für Sozialversicherungen (AHV/AVS), Pensionskassen (BVG/LPP) und Quellensteuer. Wir kümmern uns auch um die Kommunikation mit Versicherern, einschließlich Mitarbeiteranmeldungen, Mutationen und Jahresmeldungen, damit Sie stets konform bleiben.","Question10":"Wie viel kostet die Gründung eines Einzelunternehmens?","Answer10":"Unsere Pauschalgebühr für die Gründung eines Einzelunternehmens beträgt CHF 690. Das Paket umfasst die Erstellung aller erforderlichen Rechtsdokumente, Notariatsgebühren und unsere Koordination für einen reibungslosen Ablauf. Die Handelsregistergebühr ist nicht enthalten.","Question11":"Was kostet die Gründung einer GmbH/Sàrl?","Answer11":"Unsere Pauschalgebühr für die Gründung einer GmbH/Sàrl beträgt CHF 990. Darin enthalten sind die Erstellung der notwendigen Dokumente, alle Notariatsgebühren und unsere vollständige Koordination. Die Handelsregistergebühr ist nicht im Preis enthalten.","Question12":"Was kostet die Gründung einer AG/SA?","Answer12":"Die Pauschalgebühr für die Gründung einer AG/SA beträgt CHF 1.090. Sie umfasst die Erstellung der Unternehmensdokumente (Standardvorlagen, spezifische Arbeiten außerhalb der Standardvorlagen werden separat berechnet), Notariatsgebühren und unsere vollständige Koordination von Anfang bis Ende. Die Handelsregistergebühr ist nicht enthalten.","Question13":"Bieten Sie weitere Dienstleistungen zur Firmengründung an?","Answer13":"Ja, wir bieten auch individuelle Unterstützung bei der Eröffnung von Schweizer Firmenkonten, der Erstellung maßgeschneiderter Statuten und der Vorbereitung spezifischer Unternehmensdokumente. Diese Dienstleistungen werden nach Zeitaufwand berechnet, mit Stundensätzen von CHF 175 bis CHF 350, abhängig von der Komplexität."},"Footer":{"Product":{"Title":"Produkt","Overview":"Überblick","Features":"Funktionen","Solutions":"Lösungen","Tutorials":"Anleitungen","Pricing":"Preise","Releases":"Versionen"},"Company":{"Title":"Unternehmen","AboutUs":"Über uns","Careers":"Karriere","Press":"Presse","News":"Neuigkeiten","MediaKit":"Medienkit","Contact":"Kontakt"},"Resources":{"Title":"Ressourcen","Blog":"Blog","Newsletter":"Newsletter","Events":"Veranstaltungen","HelpCentre":"Hilfezentrum","Tutorials":"Anleitungen","Support":"Support"},"Social":{"Title":"Soziale Medien","LinkedIn":"LinkedIn"},"Legal":{"Title":"Rechtliches","Terms":"Bedingungen","Privacy":"Datenschutz","Cookies":"Cookies","Licenses":"Lizenzen","Settings":"Einstellungen","Contact":"Kontakt"},"Copyright":"Ark Fiduciaire SA. Alle Rechte vorbehalten"},"Accounting":{"Title":"Buchhaltung","Description":"Wir bieten umfassende Buchhaltungsdienstleistungen, einschließlich Buchführung, Finanzberichterstattung und Einhaltung der Schweizer Rechnungslegungsstandards. Unser Team sorgt für eine präzise und zeitnahe Finanzverwaltung Ihres Unternehmens."},"TaxesCompanyPersonal":{"Title":"Steuern - Unternehmen und Privat","Description":"Wir übernehmen alle Aspekte der Steuerkonformität, einschließlich Mehrwertsteueranmeldung, Unternehmenssteuererklärungen und persönliche Einkommensteuererklärungen."},"PayrollHR":{"Title":"Lohn & Personal","Description":"Wir übernehmen die Lohnabrechnung, einschließlich Gehaltsberechnung, Erstellung von Lohnabrechnungen und Einhaltung der Schweizer Sozialversicherungsvorschriften."},"OutsourcingServices":{"Title":"Outsourcing-Dienstleistungen","Description":"Wir bieten Outsourcing-Dienstleistungen für juristische, administrative und buchhalterische Aufgaben an, damit Sie sich auf Ihr Kerngeschäft konzentrieren können, während wir die notwendigen Backoffice-Funktionen übernehmen."},"CorporateServices":{"Title":"Firmendienstleistungen","Description":"Wir bieten eine Reihe von Firmendienstleistungen an, darunter Firmengründung, Compliance-Management und Unterstützung bei der Unternehmensführung, damit Ihr Unternehmen reibungslos und gemäß den Schweizer Vorschriften funktioniert."},"CompanyIncorporation":{"Title":"Firmengründung","Description":"Wir unterstützen Sie bei der gesamten Firmengründung, einschließlich rechtlicher Dokumentation, Notariatsdienstleistungen und Eintragung ins Handelsregister."},"DomiciliationServices":{"Title":"Domizilierungsdienste","Description":"Domizilierungsdienste bieten Unternehmen eine eingetragene Adresse für rechtliche, administrative und kommerzielle Zwecke. Diese Dienste ermöglichen es Unternehmen, ihren offiziellen Sitz zu etablieren, Post zu empfangen und regulatorische Anforderungen zu erfüllen, ohne ein physisches Büro am Standort zu benötigen."},"OdooImplementation":{"Title":"Odoo-Implementierung","Description":"Wir sind offizielle Odoo-Partner und bieten vollständige Implementierungs- und Konfigurationsdienstleistungen, damit Ihr Odoo-System den Schweizer Buchhaltungsstandards entspricht."},"Services":{"Title":"Unsere Dienstleistungen"}},"Testimonials":{"SectionTitle":"Referenzen","List":[{"name":"Alex Weber","designation":"Geschäftsführer","company":"Swiss Innovations GmbH","testimonial":"Die Zusammenarbeit mit ihnen hat unsere Finanzprozesse komplett verändert. Die Effizienz, mit der unsere Buchhaltung und Lohnabrechnung über Odoo verwaltet werden, ist unschlagbar! Wir können uns jetzt auf unser Geschäft konzentrieren und wissen, dass unsere Compliance in besten Händen ist."},{"name":"Clara Dubois","designation":"Geschäftsleiterin","company":"Léman Distribution SA","testimonial":"Ein großartiger Service, der die Komplexität der Schweizer Buchhaltung und swissdec-Lohnabrechnung vereinfacht. Sehr zu empfehlen für jedes KMU. Ihr flexibler Ansatz ermöglicht es uns, die tägliche Rechnungsstellung selbst zu übernehmen, während sie den Monatsabschluss und die Steuern reibungslos managen."},{"name":"Marco Rossi","designation":"Gründer","company":"Ticino Start-up","testimonial":"Die Zusammenarbeit auf Odoo ist erstklassig! Wir haben einen klaren, aktuellen Überblick über unsere Finanzen und das Team steht uns immer zur Seite. Die Implementierung verlief reibungslos und war perfekt auf unsere Bedürfnisse zugeschnitten."},{"name":"Sophie Müller","designation":"HR-Managerin","company":"Alpine Precision AG","testimonial":"Seit der Auslagerung unserer Lohnabrechnung hat sich unsere HR-Effizienz deutlich verbessert. Das Team übernimmt alle swissdec-Meldungen und Versicherungsangelegenheiten fehlerfrei – ein echter Gewinn für unser kleines Team."},{"name":"Liam Schneider","designation":"Geschäftsführer","company":"Zurich Solutions","testimonial":"Die beste Investition in unser Backoffice. Das Support-Team ist unglaublich reaktionsschnell und kompetent und beantwortet unsere Fragen zu Buchhaltung und Odoo. Ihr Service ist seit unserer Gründung von unschätzbarem Wert."},{"name":"Isabelle Favre","designation":"Inhaberin","company":"Geneva Consulting","testimonial":"Ihr Service hat mir viele Stunden Verwaltungsarbeit erspart! Die Finanzberichte und Analysen sind äußerst hilfreich und leicht verständlich. Das hilft uns, klügere, datenbasierte Entscheidungen für unser Wachstum zu treffen."}]}}}');

